import React, { useContext } from "react";
import car from "../images/car.png";
import { GlobalContext } from "../context/GlobalState";
import { car_make, car_models } from "../data";
import { useForm } from "react-hook-form";
import { useHistory } from "react-router-dom";
import _ from "lodash";

const CarFormDetails = () => {
  const { updateCarInfo } = useContext(GlobalContext);

  const history = useHistory();

  const { register, handleSubmit, errors } = useForm();

  const onSubmit = (data) => {
    console.log(data);

    updateCarInfo(data);

    history.push("/insurance-quotes");
  };

  return (
    <>
      <div className="car-details">
        <div className="details-intro">
          <div className="intro-img">
            <img src={car} alt="" />
          </div>
          <p>
            <b>Fill in the information about your vehicle</b>
          </p>
        </div>
        <form className="car-input-form" onSubmit={handleSubmit(onSubmit)}>
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-4 col-12">
                <select>
                  <option value="">Select car make</option>
                  {car_make.map((m, i) => (
                    <option key={i} value={m.id}>
                      {m.name}
                    </option>
                  ))}
                </select>
              </div>
              <div className="col-md-4 col-12">
                <select>
                  <option value="">Select car model</option>
                </select>
              </div>
            </div>
            <div className="row">
              <div className="col-md-4 col-12">
                <select>
                  <option value="">Year of manufacture</option>
                  {_.range(1999, 2021, 1).map((_n, i) => (
                    <option value={_n} key={i}>
                      {_n}
                    </option>
                  ))}
                </select>
              </div>
              <div className="col-md-4 col-12">
                <select>
                  <option value="">Fuel Type</option>
                  <option value="">Petrol</option>
                  <option value="">Diesel</option>
                </select>
              </div>
            </div>
            <div className="row">
              <div className="col-md-8 col-12">
                <input type="text" placeholder="Car estimated value" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-8 col-12">
                <input type="text" placeholder="Enter mobile number" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-8 col-12">
                <button type="submit">SHOW ME QUOTES</button>
              </div>
            </div>
          </div>
        </form>
      </div>
    </>
  );
};

export default CarFormDetails;
